import React from 'react';
import CardBody from './card-body';
import CardHead from './card-head';

function Archive() {
  return (
    <>
      <div className={`card-box`}>
        <div className={`display-flex archive h-top bg-grey-2 cursor-pointer`}>
          <div className="icon-box">
            <i className="fas fa-archive"></i>
          </div>
          <div>Archive</div>
        </div>
        <div className="bg-grey-3 card-body flex-center flex-column">
          <div className="column">
            <div className={`card-box bg-grey-${props.index % 2}`}>
              <CardHead
                column={props.column}
                index={props.index}
                updateSectionTitle={props.updateSectionTitle}
                deleteColumn={props.deleteColumn}
                dragHandleProps={provided.dragHandleProps}
              />
              <CardBody
                reorder={props.reorder}
                column={props.column}
                index={props.index}
                setOpen={props.setOpen}
                setCardForOpen={props.setCardForOpen}
                onDragEnd={props.onDragEnd}
                addCard={props.addCard}
                convertDate={props.convertDate}
              />
            </div>
          </div>
        </div>
      </div>
    </>
  );
}
export default Archive;
